import axios from "axios";
import React, { useState } from "react";
import AuthService from "../../services/auth-service";

export default function UserSeries() {

    const [seriesList, setSeriesList] = useState([]);
    const user = AuthService.getCurrentUser();

    axios.get("https://api.betaseries.com/shows/member", {
        params : {
            id: user.user.id,
            client_id: "22f661bdce5c",
        }
    }).then(response => {
        console.log(response.data);
    })

    return(
        <div className="container content-center mx-auto">
            <div className="grid text-center grid-cols-3 gap-5 text-white">
                <div>
                    Coucou
                </div>
                <div>
                    Hello
                </div>
                <div>
                    Bonjour
                </div>
                <div>
                    Halo
                </div>
                <div>
                    Konnichiwa
                </div>
                <div>
                    Salut
                </div>
                <div>
                    Ipsum
                </div>
            </div>
        </div>
    )
}
